import React from "react";

import { Link } from "react-router-dom";
import StudentData from "./StudentData";

function StudentView() {
    const items = StudentData

    return (
    <div>
        {items.map(item => {
            <h1 key={item.id}>
            <Link>{item.name}</Link>

            </h1>
        })}
    </div>

  )
}

export default StudentView;
